import React from 'react';
import homeIcon from './assets/home.png';
import scoresIcon from './assets/scores.png';
import collectionIcon from './assets/collection.png';
import clubIcon from './assets/club.png';

function NavBar() {
  return (
    <nav className="nav-bar">
      <div className="nav-item active">
        <img src={homeIcon} alt="Home" className="icon"/>
        Home
      </div>
      <div className="nav-item">
        <img src={scoresIcon} alt="Scores" className="icon"/>
        Scores
      </div>
      <div className="nav-item">
        <img src={collectionIcon} alt="Collection" className="icon"/>
        Collection
      </div>
      <div className="nav-item">
        <img src={clubIcon} alt="Club" className="icon"/>
        Club
      </div>
    </nav>
  );
}

export default NavBar;
